Class('Ariadne.ExtJSComponentQueryFinder.Identifier.ItemId', {
    
    isa         : Ariadne.QueryFinder.Identifier,
    
    methods : {
        
        identify : function (target, root, maze) {
            var itemId      = target.itemId
            
            if (itemId)
                return {
                    query           : '#' + itemId,
                    weight          : -1000
                }
        }
    }
});
